// React
import React from "react";
import MenuCollections from "./MenuCollections";
import MenuInstallations from "./MenuInstallations";

function Home({
  splashImages,
  collections,
  dateCollections,
  installations,
  isLoading,
}) {
  return (
    <div
      style={{
        display: "flex",
        flexDirection: "row",
        position: "absolute",
        top: "64px",
        left: "0px",
        right: "0px",
        bottom: "64px",
        padding: "32px",
        overflow: "hidden",
        alignContent: "center",
      }}
    >
      <div style={{ maxWidth: "1200px" }}>
        <MenuCollections
          collections={collections}
          dateCollections={dateCollections}
          isLoading={isLoading}
        />
        <MenuInstallations
          installations={installations}
          isLoading={isLoading}
        />
      </div>
      {splashImages && splashImages[0] && (
        <img
          src={splashImages[0].url}
          style={{
            width: "50%",
            objectFit: "cover",
          }}
        ></img>
      )}
    </div>
  );
}

export default Home;
